  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains polygons which represent
  justice of the peace boundaries for the State of Arkansas. By Arkansas law, the
  political subdivisions of the State are required to review the boundary lines of
  various election districts after each decennial census. This ensures the citizens
  of the county are equally represented by their elected officials. This process is
  widely known as redistricting. The process of establishing new districts or updating
  boundary lines is subject to certain constitutional and statutory requirements.
  The number of Quorum Court districts per county in Arkansas is based upon population
  ranges (Arkansas Code 14-14-402). The number of Quorum Court districts per county
  in Arkansas is based upon population ranges (Arkansas Code 14-14-402). 14-14-402.
  Number of Districts. The number of convenient quorum court districts to be established
  in each county shall be determined according to the following population categories:
  Quorum Court Districts Population 9 0 to 19,999 11 20,000 to 49,999 13 50,000 to
  199,999 15 200,000 and above Furthermore, apportionment of those districts is the
  responsibility of the county board of election commissioners and shall be based
  upon federal decennial census information (Arkansas Code 14-14-403 and 14-14-404).\",\n\t\"owner_org\":
